A transaction typically begins with:
`BEGIN WORK;`
You can then do multiple statements:
`INSERT INTO table1 VALUES (1,2,3,4);
`INSERT INTO tablea VALUES ('a','b');

And then either 'COMMIT' to apply both changes at once, or `ROLLBACK` to undo them both and restore the database.

